LifeSensor.description:
Senses and detects organic life up to a distnace of 2000 studs. Used mainly in programming, as is used in alien technology to hunt down organisms such as players.
Has a special programmable event called 'GetReading()' which returns a table of all organisms, with their positions and names.
Example:
{
	Player1 = Vector3.new(5, 5, 5);
}

Microphone.codesample:
local microphone = GetPart("Microphone")

local whitelisted = {
	[YOUR_USER_ID_HERE] = true,
}

local commands = {
	echo = function(userId, arguments)
		print(table.concat(arguments, " "))
	end,
}

microphone:Connect("Chatted", function(userId, message)
	if not whitelisted[userId] then return end

	local arguments = message:split(" ")
	local command = table.remove(arguments)

	local callback = commands[command]
	if callback then
		callback(userId, arguments)
	end
end)

